import './intro.scss';

const intro = () => {
  return (
    <>
      <div className="intro" id="intro">
        <div className="left">
          <div className="imageContainer">
            <img src="assets/man.png" alt="img" />
          </div>
        </div>
        <div className="right"></div>
      </div>
    </>
  );
};

export default intro;
